import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import React from "react";
const Routes = [
  {
    name: "Home",
    path: "/",
  },
  {
    name: "Login",
    path: "/",
  },
  {
    name: "Sign up",
    path: "/",
  },
  {
    name: "Profile",
    path: "/",
  },
];
export const Header = () => {
  return (
    <>
      {Routes.map((route) => {
        return (
          <Menu open={true}>
            <MenuItem>{route.name}</MenuItem>
          </Menu>
        );
      })}
    </>
  );
};
